import './Navbar.css';
import { Link } from 'react-router-dom';
import React from 'react';

function Navbar() {
  return(
    React.createElement("header", { className: "navbar" }, 
    React.createElement("div", { className: "navbar__title"},<Link to="/"><img className="logo" src="webshio.png" alt=""/> 
    </Link>),
    React.createElement("div", { className: "navbar__item"},<Link to="add-item">Item
    </Link>), 
    React.createElement("div", { className: "navbar__item"},<Link to="add-category">Category</Link>), 
    React.createElement("div", { className: "navbar__item"},<Link to="cart">Cart</Link>)
  ))
}


export default Navbar
